import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Menu() {
	return (
		<div>
			<nav className="navbar navbar-expand-md navbar-dark bg-dark">

				<a className="navbar-brand" href="#">Escala Test</a>

				<button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
					<span className="navbar-toggler-icon"></span>
				</button>

				<section className="collapse navbar-collapse" id="navbarNavAltMarkup">
					<div className="navbar-nav my-md-0">
						<Link to="/Classificacao">
							<a className="nav-item nav-link">Classificação</a>
						</Link>
						<Link to="/Escalacao">
							<a className="nav-item nav-link">Escalação</a>
						</Link>
					</div>
				</section>

			</nav>

		</div>
	);
}

export default Menu;
